import React from 'react';
import {
    BrowserRouter as Router,
    Switch,
    Route
  } from "react-router-dom";
import { CvEditor, Login, Register } from 'routes';

const App = () => {
    return (
        <Router>
            <Switch>
            <Route path="/cv">
                <CvEditor />
            </Route>
            <Route path="/login">
                <Login/>
            </Route>
            <Route path="/">
                <div>hello</div>
            </Route>
            </Switch>
        </Router>
    );
}


export default App;
